import React from 'react';
import map from '../../assets/icons/map.svg'

const AboutUs = () => {
    return (
        <div>
            <div className='p-[100px] flex'>
                <div className='flex flex-col'>
            <h2 className='text-[34px] font-bold'>BioSpectra</h2>
            <p className='text-[25px] font-medium w-[460px]'>Focused on utilizing data spectroscopy and visualization for biodiversity analysis and monitoring in South Africa.</p>
                </div>
            <img src={map} alt="" />
            </div>
        </div>
    );
}

export default AboutUs;
